import "./style.css";

function Calculator() {
  const values = [
    "AC",
    "DEL",
    "%",
    "/",
    "7",
    "8",
    "9",
    "X",
    "6",
    "5",
    "4",
    "-",
    "3",
    "2",
    "1",
    "+",
    "0",
    ",",
    "=",

  ];

  const buttons = values.map((value) => (
    parseFloat(value) == isNaN ? <button className="numbers" id={"btn_" + value}>{value}</button> : <button className="simbols" id={"btn_" + value}>{value}</button>
  ));

  return (
    <div id="content">
      <div id="calculator">
        <div id="box-calculator">{buttons}</div>
      </div>
    </div>
  );
}

export default Calculator;
